import React, { Component } from "react";
import UserItem from "./UserItem";

class Users extends Component {
  renderTable = () =>{
    const {userList} = this.props;
  }
  render() {
    return (
      <div>
        <table className="table">
          <thead>
            <tr>
              <th>Name</th>
              <th>Username</th>
              <th>Email</th>
              <th>Phone Number</th>
              <th>Type</th>
            </tr>
          </thead>
          <tbody>
            <UserItem />
            <UserItem />
            <UserItem />
          </tbody>
        </table>
      </div>
    );
  }
}

export default Users;
